import React from "react";
import styles from "./filter.module.css";

const Filter = ({ searchContact, value, onFilter }) => {
  return (
    <div>
      <h2>Search</h2>
      <form>
        <input
          className={styles.form}
          type="text"
          placeholder="search"
          value={value}
          onChange={onFilter}
        />
      </form>
    </div>
  );
};

export default Filter;
